import unittest
from L451_Sort_Characters_By_Frequency import Solution


def check_correctness(input_string: str, sorted_string: str):
    """Check is sorted correctly"""

    frequency_dict = {}

    for char in input_string:
        frequency_dict[char] = frequency_dict.get(char, 0) + 1

    while len(sorted_string) > 0:

        biggest = max(frequency_dict.values())
        char_frequency = frequency_dict.get(sorted_string[0])

        if biggest == char_frequency:
            frequency_dict.pop(sorted_string[0])
            sorted_string = sorted_string[biggest:]
            continue

        return False

    return True


class MyTestCase(unittest.TestCase):

    def setUp(self) -> None:
        self.sol = Solution()

    def test_small_input(self):
        """Up to 10 chars"""
        tests = [
            "tree",
            "cccaaa",
            "bca",
            "Aabb",
            "ba4hxe3ta"
        ]

        for test in tests:
            answer = self.sol.frequencySort(test)
            self.assertTrue(check_correctness(test, answer))

    def test_medium_input(self):
        """Up to 50 chars"""
        tests = [
            "cbddddcadbcbadbacdacbcbcdababc",
            "caacbabacbcadbbadbacccdabddaaaccabc",
            "bbcadcbbacdbabdddabbbaccbbaabcaddccddbdd",
            "ccadbdabdadababacdcdcdbccdbabbacbacabdcccbcab",
            "dbbadcabbbbbbcbccddcabdcabacacbbbcbbdccccbcbddcdab"
        ]

        for test in tests:
            answer = self.sol.frequencySort(test)
            self.assertTrue(check_correctness(test, answer))


    def test_huge_input(self):
        """Up to 50K chars"""

        test = ""

        answer = self.sol.frequencySort(test)
        self.assertTrue(check_correctness(test, answer))

if __name__ == '__main__':
    unittest.main()
